import React from 'react';
import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from 'react-router-dom';
import {
  Button
  } from '@material-ui/core';

import Dashboard from './Dashboard';
import ThreatMap from './ThreatMap';

function App(){
  return(
    <BrowserRouter>
      <AppBar color="primary">
        <Toolbar>
          <Typography>Demo App</Typography>
          </Toolbar>
      </AppBar>
      <div>
        <Button color="primary" component={Link} to="/">
          Home
        </Button>
        <Button color="primary" component={Link} to="/network-threat-map">
          Network incidents near you
        </Button>
        <Switch>
          <Route path='/network-threat-map'>
            <ThreatMap />
          </Route>
        </Switch>
      </div>
    </BrowserRouter>
  );
};

export default App;
